import React from "react";
import Nav from "./../components/layout/NavBar.js"
function Home(){
  const sections = [
    { title: 'Home', url: '/' },
    { title: 'Login', url: '/Login' },
    { title: 'Post', url: '/Post' },
    { title: 'Business', url: '#' },
    { title: 'Politics', url: '#' },
    { title: 'Opinion', url: '#' },
    { title: 'Science', url: '#' },
    { title: 'Health', url: '#' },
    { title: 'Style', url: '#' },
    { title: 'Travel', url: '#' },
  ];
  return(
  <div>
  <Nav title="Blog" sections={sections}/>
  <h1> Home </h1>
  </div>);
}
export default Home;
